function TongjiInvitecode(mRecord,mData)
    local oBackendObj = global.oBackendObj
    local mServer = oBackendObj:GetServerList()
    local iTaptap,iZhongce,iKaopu = 0,0,0
    for _,oServer in pairs(mServer) do
        local oGameDb = oServer.m_oGameDb:GetDb()
        local m = oGameDb:Find("invitecode", {}, {invitecode=true})
        while m:hasNext() do
            local mUnit = m:next()
            mongoop.ChangeAfterLoad(mUnit)
            local code = mUnit.invitecode
            if code and table_in_list(TaptapCode,code) then
                iTaptap = iTaptap + 1
            elseif  code and table_in_list(ZhongceCode,code) then
                iZhongce = iZhongce + 1
            elseif  code and table_in_list(KaopuCode,code) then
                iKaopu = iKaopu + 1
            end
        end
    end
    record.info("taptap: "..iTaptap)
    record.info("zhongce: "..iZhongce)
    record.info("kaopu: "..iKaopu)
end